#!/usr/bin/env python3

from Crypto.Util.number import *

flag = open("flag.txt").read().strip()
m1 = flag[:len(flag)//2].encode()
m2 = flag[len(flag)//2:].encode()


def encrypt_1(bits, m):
    m = bytes_to_long(m)
    p = getPrime(bits)
    q = getPrime(bits)
    n = p*q
    c = pow(n+1, m, pow(n, getPrime(7) + 69))
    return c, n

def encrypt_2(bits, m):
    while 0x1337:
        x = getRandomInteger(bits) << 2
        p, q = pow(x, 3) + x + 1, pow(x, 2) + 3*x + 1
        if isPrime(p) and isPrime(q):
            break

    n = pow(x, 8) + 3*pow(x, 7) + 3*pow(x, 6) + 8*pow(x, 5) + 9*pow(x, 4) + 7*pow(x, 3) + 8*pow(x, 2) + 5*x + 1
    m = bytes_to_long(m)
    c = pow(m, n, n)

    return c, n


c1, n1 = encrypt_1(512, m1)
c2, n2 = encrypt_2(512, m2)

